import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Header';

const Home = () => <div>Home Page</div>;
const Books = () => <div>Books Page</div>;
const EBooks = () => <div>E-Books Page</div>;
const Goods = () => <div>Goods Page</div>;
const Bestseller = () => <div>Bestseller Page</div>;
const Login = () => <div>Login Page</div>;
const Join = () => <div>Join Page</div>;
const MyPage = () => <div>MyPage Page</div>;
const Cart = () => <div>Cart Page</div>;

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/books" component={Books} />
          <Route path="/e-books" component={EBooks} />
          <Route path="/goods" component={Goods} />
          <Route path="/bestseller" component={Bestseller} />
          <Route path="/login" component={Login} />
          <Route path="/join" component={Join} />
          <Route path="/mypage" component={MyPage} />
          <Route path="/cart" component={Cart} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
